// src/components/Birthdays.js
import React, { useEffect, useState } from 'react';

const Birthdays = () => {
    const [birthdays, setBirthdays] = useState([]);
    const [error, setError] = useState(null);

    const fetchBirthdays = async () => {
        const token = localStorage.getItem('token'); // Adjust based on your auth method
        try {
            const response = await fetch('/api/birthdays/', {
                method: 'GET',
                headers: {
                    'Authorization': `Token ${token}`, // For Token Authentication
                    'Content-Type': 'application/json'
                }
            });

            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }

            const data = await response.json();
            setBirthdays(data); // Update state with fetched data
        } catch (error) {
            setError('Error fetching birthdays: ' + error.message);
            console.error('Error fetching birthdays:', error);
        }
    };

    useEffect(() => {
        fetchBirthdays(); // Call the function on component mount
    }, []);

    return (
        <div>
            <h2>Birthdays</h2>
            {error && <div style={{ color: 'red' }}>{error}</div>} {/* Show error messages */}
            <ul>
                {birthdays.map((birthday) => (
                    <li key={birthday.id}>
                        {birthday.name} - {birthday.date}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Birthdays;
